import React from 'react';
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';

class App extends React.Component {
  render() {
    return (
      <Form>
        <FormGroup>
          <Label for="Name">Name</Label>
          <Input
            type="text"
            name="name"
            onChange={this.handleChange} />
        </FormGroup>
        <Button>Submit</Button>
      </Form>
    );
  }
}

export default App;
